import React from "react";
import ReactDom from "react-dom";
import "./index.css";

const name = "Pawan Chauhan";
// const img = require("./img1.jpeg");
const img = "https://picsum.photos/200/300.jpg";
const img1 = "https://picsum.photos/210/300.jpg";
const img2 = "https://picsum.photos/230/300.jpg";
const img3 = "https://picsum.photos/250/300.jpg";
const img4 = "https://picsum.photos/205/300.jpg";
const img5 = "https://picsum.photos/215/300.jpg";
const img6 = "https://picsum.photos/220/300.jpg";
const img7 = "https://picsum.photos/240/300.jpg";
ReactDom.render(
  <>
    <h1 className="heading">{`I am ${name}.I am a God`}</h1>
   <div className="img1"></div>


    <img src={img} alt="random Image" />
    <img src={img1} alt="random Image" />
    <img src={img2} alt="random Image" />
    <img src={img3} alt="random Image" />
    <img src={img4} alt="random Image" />
    <img src={img5} alt="random Image" />
    <img src={img6} alt="random Image" />
    <img src={img7} alt="random Image" />
  </>,
  document.getElementById("root")
);
